import React from 'react';
import Box from '@material-ui/core/Box';

const SlideWindow = ({ color }) => {
    return (
        <Box
            style={{
                backgroundColor: color,
                width: '200px',
                height: '200px'
            }}
        >
            Slide information here 
        </Box>
    );
};

export default SlideWindow;
